  styleUrls: ['tab3.page.scss']
})
export class Tab3Page {
  user : User[] = [];

  constructor(private dataService: DataService) {

    this.dataService.getUser().subscribe(res => {
      console.log(res);
      this.user = res;
    });
  }

}
